int _js_image_loader_js(struct mg_connection *conn)
{
    mg_send_header(conn, "Content-Type", "text/js");
    mg_send_header(conn, "Cache-Control", "public, max-age=604800");
    mg_printf_data(conn, "(function ($) {\n"
"    'use strict';\n"
"\n"
"    $(function () {\n"
"        $('img').each(function () {\n"
"            var src = $(this).data('src'),\n"
"		elem = $(this);\n"
"            $.ajax({\n"
"                url: src,\n"
"                success: function (data) {\n"
"                    elem.attr('src', 'data:image/png;base64,' + data);\n"
"                }\n"
"            });\n"
"        });\n"
"    });\n"
"}(window.jQuery));\n"
);
    return MG_TRUE;
}


